// Variables y Constantes
const nombre = 'Pablo';
const apellido = 'Saiz';

let valorDado = 5;
valorDado = 4;

console.log(nombre, apellido, valorDado);

if (true){
    let valorDado = 6;

    console.log(valorDado);
}

console.log(valorDado);
